# number = '12345678911231234567891123'
number = ''
number1 = int(number)
array1= []
array2= []

for i in number:
  i = int(i)
  array1.append(i)

a = len(array1)
x = 0
y = 12

while y < a :
  c = 1
  for i in range(x,y+1):
    b = array1[i]
    c = c*b
  
  array2.append(c)
  x += 1
  y += 1

print(array2)

z = 1
check = 1

while z < len(array2):
  if check < array2[z] :
      check = array2[z]

  z += 1
